  public void render(Entity entity, float f, float f1, float f2, float f3, float f4, float f5)
  {
    super.render(entity, f, f1, f2, f3, f4, f5);
    setRotationAngles(f, f1, f2, f3, f4, f5);
    Body.render(f5);
  }
  
  private void setRotation(PixelmonModelRenderer model, float x, float y, float z)
  {
    model.rotateAngleX = x;
    model.rotateAngleY = y;
    model.rotateAngleZ = z;
  }
  
  public void setRotationAngles(float f, float f1, float f2, float f3, float f4, float f5)
  {
	  RightClaw.rotateAngleX = MathHelper.cos(f * 1F) * 1.1F * f1;
		LeftClaw.rotateAngleX = MathHelper.cos(f * 1F + (float) Math.PI) * 1.1F * f1;
		RightClaw.rotateAngleX = MathHelper.cos(f2 * .15F + (float) Math.PI) * .5F * .5F - .5F;
		LeftClaw.rotateAngleX = MathHelper.cos(f2 * .15F) * .5F * 0.5F - .5F;
		RightClaw.rotateAngleY = MathHelper.sin(f2 * .15F) * .5F * 0.5F;
		LeftClaw.rotateAngleY = MathHelper.sin(f2 * .15F + (float) Math.PI) * .5F * 0.5F;
  }

